import {v4 as uuidv} from 'uuid'
//生成随机字符串 ，本地持久化
export const getUUID=()=>{
    let uuid_token=localStorage.getItem('UUIDToken')
    if(!uuid_token){
        uuid_token=uuidv4
    }
}
